const Footer = (props) => {

    return (
        <div className="">
            <a href="https://twitter.com/BrandonTheDev" target="_blank">
                                <i class="fa fa-twitter-square"></i>
                            </a>
                            <a href="https://www.linkedin.com/in/brandon-hogan-9994b0153/" target="_blank">
